import {
    getStorage,
    ref,
    uploadBytes,
    getDownloadURL,
    getByte,
  } from "firebase/storage";
import 'firebase/auth';
import 'firebase/firestore';
import { getAuth } from 'firebase/auth'
import { initializeApp } from "firebase/app";
import {
    getFirestore,
    collection,
    addDoc,
    getDoc,
    doc,
    getDocs,
    query,
    where,
    setDoc,
    deleteDoc,
  } from "firebase/firestore";

